import React from 'react';
import './Cell.css';
import { createRoot } from 'react-dom/client';
import { Stage, Layer, Rect, Text, Circle, Line } from 'react-konva';

function Cell() {
  return (
    <Stage width={window.innerWidth} height={window.innerHeight}>
      <Layer>
        <div>
            <Rect
            x={50}
            y={50}
            width={100}
            height={100}
            fill="black"
            shadowBlur={0}
            />
        </div>
      </Layer>
    </Stage>
  );
}

export default Cell;
